 Here is a simple JavaScript function that will sort the keys of a dictionary (also known as an object) alphabetically and then output the values corresponding to those sorted keys.

```javascript
function sortDictByKey(dict) {
    var keyArray = Object.keys(dict).sort(); // sorts the keys alphabetically
    var outputStr = "";

    for (var i=0; i<keyArray.length; i++) {
        outputStr += dict[keyArray[i]] + "\n";
    }

    return outputStr;
}
```

You can use this function like so:

```javascript
var myDict = {
    "apple": 5,
    "banana": 3,
    "orange": 7,
    "kiwi": 9
};

console.log(sortDictByKey(myDict)); // Outputs: apple
                                      //         banana
                                      //         kiwi
                                      //         orange
```
